import React from "react";
import './navbar.css';
import logo from '../../assets/logo.png';
function Navbar() {
    return (
        <nav className="navbar">
            <img src={logo} alt="" />
            <div className="desktopMenu">
                <button className="desktopMenubtn">
                    <img src="" alt="" className="desktopMenuImg" />Contect Me
                </button>
            </div>
        </nav>
    )
}
export default Navbar;
